export default {
  // Auth endpoints
  login_api: '/signin',
  signup_api: '/signup',
  logout_api: '/signout',

  // Product endpoints
  get_products_api: '/public/products',
  create_products_api: '/public/products',
  update_products_api: id => `/public/products/${id}`,
  delete_products_api: id => `/public/products/${id}`,
  get_product_api: id => `/public/products/${id}`,

  // Cart endpoints
  cart_api: '/cart',
  add_to_cart_api: '/cart/add',
  update_cart_api: id => `/cart/${id}`,
  delete_from_cart_api: id => `/cart/${id}`,

  // Order endpoints
  get_orders_api: '/orders',
  create_order_api: '/orders/checkout',
  get_order_api: id => `/orders/${id}`,

  // User endpoints
  get_user_profile_api: '/user/profile',
  update_user_profile_api: '/user/profile',
  get_user_orders_api: '/user/orders',
  get_user_cart_api: '/user/cart',

  // Admin endpoints
  get_all_users_api: '/admin/users',
  get_user_api: id => `/admin/users/${id}`,
  update_user_api: id => `/admin/users/${id}`,
  delete_user_api: id => `/admin/users/${id}`,

  // Cloudinary config (if needed)
  cloudinary_upload_url: `https://api.cloudinary.com/v1_1/newpoint/image/upload`
};
